import streamlit as st
st.set_page_config(page_title="Mirana Primes", page_icon=":wolf:")

def is_fermat_prime(n):
    return n in mirana

def main():
    st.title("Fermat Primes and Solutions")
    st.write("Enter two numbers to check if they are Fermat primes and see their solutions.")

    number1 = st.number_input(label="Enter the First Number:", step=1)
    number2 = st.number_input(label="Enter the Second Number:", step=1)

    button_clicked = st.button("Calculate")

    if button_clicked:
        if is_fermat_prime(number1) and is_fermat_prime(number2):
            st.write(number1, "is a Fermat prime")
            st.write(number2, "is a Fermat prime")

            st.write("Solutions of", number1, "are:")
            Index1 = mirana.index(number1)
            a = A[Index1]
            b = B[Index1]
            st.write(a, b)

            st.write("Solutions of", number2, "are:")
            Index2 = mirana.index(number2)
            c = A[Index2]
            d = B[Index2]
            st.write(c, d)

            comp1 = (a * c + b * d)
            comp2 = (a * d - b * c)
            comp3 = (a * c - b * d)
            comp4 = (a * d + b * c)
            OUTPUT1 = comp1 ** 2 + comp2 ** 2
            OUTPUT2 = comp3 ** 2 + comp4 ** 2

            st.write("PROOF: (ac + bd)^2 + (ad - bc)^2 =", comp1, '^2', "+", comp2, '^2', "=", comp1 ** 2, "+",
                     comp2 ** 2, "=", OUTPUT1)
            st.write("PROOF: (ac - bd)^2 + (ad + bc)^2 =", comp3, '^2', "+", comp4, '^2', "=", comp3 ** 2, "+",
                     comp4 ** 2, "=", OUTPUT2)
            st.write("Therefore", OUTPUT1, 'is the sum of the squares of', comp1, "and", comp2, "as well as", comp3,
                     "and", comp4)

        else:
            if number1 not in mirana:
                st.write(number1, "is not a Fermat Prime")
            if number2 not in mirana:
                st.write(number2, "is not a Fermat Prime")
            if number1 not in mirana and number2 not in mirana:
                st.write("Both input numbers are not Fermat primes.")

if __name__ == "__main__":
    main()


